import {useEffect} from 'react';
import axios from 'axios';

function GetAccountByID() {

    useEffect(() => {
        axios.get('http://localhost:8080/accounts/1')
            .then(res=> {
                console.log(res.data)
            }).catch(err => {
            console.log(err)
        })
    },[])
}

export default GetAccountByID;
